import './App.css';
import { useEffect, useState } from 'react';
import axois from 'axios';
import { Button } from 'bootstrap';

function App() {
  const [hello, setHello] = useState('');
  useEffect(() => {
    axois
      .get('/api/hello')
      .then((res) => setHello(res.data))
      .catch((err) => console.log(err));
  }, []);

  return (
    <div className="App">
      Spring : {hello}
      <Button>123</Button>
    </div>
  );
}

export default App;
